import React, { useState } from 'react';
import styles from './Downloads.module.css';
import useScrollAnimation from '../../hooks/useScrollAnimation';

const Downloads = () => {
  const [headerRef, headerVisible] = useScrollAnimation({ threshold: 0.2 });

  const downloads = [
    {
      id: 1,
      title: 'Annual Report 2024',
      description: 'Comprehensive overview of CEC Nepal activities, projects, and achievements throughout 2024',
      fileSize: '4.5 MB',
      type: 'PDF',
      date: 'January 2025',
      icon: 'üìÑ',
      category: 'Annual Report'
    },
    {
      id: 2,
      title: 'Annual Report 2023',
      description: 'Review of all projects completed and milestones achieved in 2023',
      fileSize: '3.8 MB',
      type: 'PDF',
      date: 'January 2024',
      icon: 'üìÑ',
      category: 'Annual Report'
    },
    {
      id: 3,
      title: 'Annual Report 2022',
      description: 'Historical data and project performance metrics from 2022',
      fileSize: '3.2 MB',
      type: 'PDF',
      date: 'February 2023',
      icon: 'üìÑ',
      category: 'Annual Report'
    },
    {
      id: 4,
      title: 'Company Brochure',
      description: 'Detailed brochure showcasing CEC Nepal services and expertise',
      fileSize: '2.1 MB',
      type: 'PDF',
      date: 'December 2024',
      icon: 'üìã',
      category: 'Brochure'
    },
    {
      id: 5,
      title: 'Service Catalog',
      description: 'Complete list of services offered by CEC Nepal',
      fileSize: '1.8 MB',
      type: 'PDF',
      date: 'November 2024',
      icon: 'üìã',
      category: 'Catalog'
    },
    {
      id: 6,
      title: 'Project Portfolio',
      description: 'Detailed information about all 66 projects in our portfolio',
      fileSize: '5.2 MB',
      type: 'PDF',
      date: 'December 2024',
      icon: 'üìä',
      category: 'Portfolio'
    },
    {
      id: 7,
      title: 'Technical Guidelines',
      description: 'Guidelines for hydropower project feasibility and design',
      fileSize: '2.8 MB',
      type: 'PDF',
      date: 'October 2024',
      icon: 'üìò',
      category: 'Guidelines'
    },
    {
      id: 8,
      title: 'Case Studies',
      description: 'Detailed case studies of successful projects',
      fileSize: '3.5 MB',
      type: 'PDF',
      date: 'September 2024',
      icon: 'üìó',
      category: 'Case Studies'
    },
  ];

  const categories = ['All', 'Annual Report', 'Brochure', 'Catalog', 'Portfolio', 'Guidelines', 'Case Studies'];
  const [selectedCategory, setSelectedCategory] = useState('All');

  const filteredDownloads = selectedCategory === 'All' 
    ? downloads 
    : downloads.filter(item => item.category === selectedCategory);

  const handleDownload = (item) => {
    alert(`Downloading: ${item.title}\nFile will be downloaded as ${item.title}.pdf`);
    // In a real application, this would trigger an actual file download
  };

  return (
    <section id="downloads" className={styles.downloads}>
      <div className={styles.container}>
        <div 
          ref={headerRef}
          className={`${styles.sectionHeader} ${headerVisible ? styles.animate : ''}`}
        >
          <h2>Downloads</h2>
          <div className={styles.line}></div>
          <p>Access annual reports, brochures, and technical documentation</p>
        </div>

        {/* Category Filter */}
        <div className={styles.categoryFilter}>
          {categories.map(category => (
            <button
              key={category}
              className={`${styles.categoryBtn} ${selectedCategory === category ? styles.active : ''}`}
              onClick={() => setSelectedCategory(category)}
            >
              {category}
            </button>
          ))}
        </div>

        {/* Downloads List */}
        <div className={styles.downloadsList}>
          {filteredDownloads.map((item, index) => (
            <div 
              key={item.id} 
              className={styles.downloadItem}
              style={{ animationDelay: `${index * 0.05}s` }}
            >
              <div className={styles.itemContent}>
                <div className={styles.icon}>{item.icon}</div>
                <div className={styles.info}>
                  <h3>{item.title}</h3>
                  <p className={styles.description}>{item.description}</p>
                  <div className={styles.metadata}>
                    <span className={styles.fileSize}>üì¶ {item.fileSize}</span>
                    <span className={styles.date}>üìÖ {item.date}</span>
                    <span className={`${styles.type} ${styles[item.type.toLowerCase()]}`}>{item.type}</span>
                  </div>
                </div>
              </div>
              <button 
                className={styles.downloadBtn}
                onClick={() => handleDownload(item)}
              >
                <span>‚¨áÔ∏è</span>
                Download
              </button>
            </div>
          ))}
        </div>

        {filteredDownloads.length === 0 && (
          <div className={styles.noResults}>
            <p>No downloads available in this category</p>
          </div>
        )}

        {/* Info Box */}
        <div className={styles.infoBox}>
          <h3>üìå Need Help?</h3>
          <p>If you cannot find the document you're looking for, please <a href="#contact">contact us</a> and we'll be happy to assist you.</p>
        </div>
      </div>
    </section>
  );
};

export default Downloads;
